class Solution:
    def gcdOfStrings(self, str1: str, str2: str) -> str:
        if str1 == str2:
            return str1
        if str1 and str2:
            n1 = len(str1)
            n2 = len(str2)
            for i in range(min(n1, n2), 0, -1):
                if not n1 % i and not n2 % i:
                    s = str1[:i]
                    if str1 == s * (n1 // i) and str2 == s * (n2 // i):
                        return s
        return ""




solve = Solution()
